import React from "react";
import { BrowserRouter, Routes, Router } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      <BrowserRouter>
        <Router>
          <navbar>
            <h4 className="logo">Health-provider</h4>
            <div className="reg-side">
              <h4>
                <a>Log in</a>
              </h4>
              <h4>
                <a>Sign up</a>
              </h4>
            </div>
          </navbar>
        </Router>
      </BrowserRouter>
    </>
  );
};

export default Navbar;
